var cart={init:function(){cart.regEvents()},regEvents:function(){$("#btn-payment").off("click").on("click",function(){window.location.href="/payment"});$(".qty").on("change",function(){var t=$(".qty"),n=[];$.each(t,function(t,i){n.push({Quantity:$(this).val(),Food:{FoodID:$(i).data("id")}})});$.ajax({url:"/Cart/Update",data:{cartModel:JSON.stringify(n)},dataType:"json",type:"POST",success:function(n){n.status==!0?window.location.href="/cart":alert("Error")}})});$(".btn-delete").off("click").on("click",function(n){n.preventDefault();$.ajax({data:{id:$(this).data("id")},url:"/Cart/Delete",dataType:"json",type:"POST",success:function(n){n.status==!0&&(window.location.href="/cart")}})})}};cart.init();